import React from 'react';
import './BrickPointing.css';
import BrickPointingImage from './Pictures/BrickPointingImage.jpg'; // Adjust the path as needed

function BrickPointing() {
  return (
    <div className="brick-pointing-container">
      <div className="brick-pointing-background" style={{ backgroundImage: `url(${BrickPointingImage})` }}>
        <div className="brick-pointing-content">
          <h1>Brick Pointing In NYC</h1>
          <p>Brick Repointing Services in New York City: Restore Your Building's Structural Integrity</p>
        </div>
      </div>
    </div>
  );
}

export default BrickPointing;
